import React from 'react';

class App extends React.Component {
  state = {
    isLoding: true
  };

  componentDidMount() {
    setTimeout(() => {
      this.setState({isLoding:false})
    }, 6000);
  }

  render(){
    const { isLoding } = this.state;
    return <div>{isLoding ? 'Loding....' : 'We are ready'}</div>
  }
}


export default App;
